Parses.Sparql:
#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
  ns:m.04l4rht ns:royalty.noble_title.holders ?y0 .  # Monarch of England
  ?y0 ns:royalty.noble_title_tenure.noble_title ?title ;
      ns:royalty.noble_title_tenure.noble_person ns:m.03p77 ;
      ns:royalty.noble_title_tenure.to_date ?to .

  ns:m.04l4rht ns:royalty.noble_title.holders ?y1 .  # Monarch of England
  ?y1 ns:royalty.noble_title_tenure.noble_person ?x ;
      ns:royalty.noble_title_tenure.from_date ?from .

  FILTER (xsd:datetime(?from) - xsd:datetime(?to) >= 0)
}
ORDER BY xsd:datetime(?from)
LIMIT 1
